import { Card, CardHeader, CardTitle, CardBody, Row, Col } from "reactstrap";
import { Link } from 'react-router-dom';


var date = new Date();
var year_ = date.getFullYear();

let checkbox_value_url = "http://bcmon.kmu.ac.kr/coin-data/ethereum/view/node/discovery/year/"
let get_yearvalue_url = checkbox_value_url+""+year_+"/results"

let dataSource = []
let url = [
    "http://bcmon.kmu.ac.kr/coin-data/ethereum/view/node/discovery/latest/results",     //최신 데이터
    get_yearvalue_url
]

class ethereumBlock extends React.Component {
  render() {

    return (
      <>
        <div className="content">
        <h2 className="text-center">Management</h2>
          <div className="title content">
            <Card className="card-firstoutline">
              <CardHeader>
                <CardTitle>
                  <h3 className="text-center">Ethereum Node Discovery</h3>
                  <p className="text-center">BcMon is currently being developed to find all the reachable nodes in the Ethereum network.</p>
                </CardTitle>
              </CardHeader>
              <Row>
                <Col lg="12">
                  <Card className="card-mini">
                      <CardBody>
                        <div className="chart-area">

                        </div>
                      </CardBody>
                  </Card>
                </Col>
              </Row>
            </Card>
          </div>
        </div>
      </>
    );
  }
}

export default ethereumBlock;
